import styled from "styled-components";

export const Container = styled.div`
  float: left;
  margin: 0;
  height: auto;
  width: auto;
`;

export const Header = styled.div`
  display: flex;
  width: 100%;
  justify-content: space-between;
`;

export const ListItems = styled.div`
  display: block;
  float: left;
  padding: 5px 0;
  width: 100%;
`;
